import React from "react";

function App() {
  return (
    <div>
      <main>
        <section>
            <img src="/Mask Group.svg" alt="iconLogo" />
            <div>
              <figure>
                <img src="/shopping-" alt="" />
              </figure>
            </div>
        </section>
        <section>
          <form>
              <h2></h2>
          </form>
        </section>
      </main>
    </div>
  );
}

export default App;
